webpackJsonp([59526005497462],{509:function(t,o){t.exports={data:{site:{siteMetadata:{title:"Пятиминутка React",author:"Пятиминутка React"}},markdownRemark:{id:"/Users/petr/www/5minreact.ru/src/pages/56-solid-book/index.md absPath of file >>> MarkdownRemark",html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/655630586&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Порекомендую книгу о знаменитых SOLID принципах ООП с примерами на TypeScript: <a href="https://ota-solid.now.sh">https://ota-solid.now.sh</a></p>\n<p>Книга написала приятным и понятным языком, совсем не большая - я не напрягаясь прочитал за выходные. Помимо описания самих SOLID принципов, по каждому из них даются как идеальные примеры, так и примеры из реальной жизни, а также описаны антипаттерны, “запахи кода”, ограничения и подводные камни.</p>\n<p>Книга интерактивная, по мере чтения нужно будет отвечать на вопросы по только что пройденному материалу - эти мини-тесты очень хорошо помогают закрепить материал. Авторы Саша Беспоясов и Артём Самофалов проделали большой труд и хорошо поработали над материалом, чтобы сделать его доступным и полезным для читателей разного уровня подготовки!</p>\n<p>Исходники книги доступны на GitHub, поддержать проект можно на Patreon.</p>\n<ul>\n<li><a href="https://ota-solid.now.sh">https://ota-solid.now.sh</a></li>\n<li><a href="https://github.com/open-tech-authors">https://github.com/open-tech-authors</a></li>\n<li><a href="https://www.patreon.com/open_tech_authors">https://www.patreon.com/open<em>tech</em>authors</a></li>\n</ul>',frontmatter:{title:"SOLID с примерами на TypeScript",date:"July 24, 2019",featuredImage:null}}},pathContext:{slug:"/56-solid-book/",previous:{fields:{slug:"/55-gitlab-salary/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/648023975&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Компания GitLab с каждым годом набирает обороты. Как ни странно для OpenSource проекта, из него получился не плохой бизнес! Что интересно, в GitLab все внутренние процессы максимально открыты и описаны в публичном Handbook, включая вилки зарплат, принцип их построения и даже интерактивный калькулятор. Воспользуемся этим калькулятором, чтобы примерить зарплату фронтенд-разработчика в GitLab на себя.</p>\n<ul>\n<li><a href="https://about.gitlab.com/handbook/">https://about.gitlab.com/handbook/</a></li>\n<li><a href="https://about.gitlab.com/handbook/people-operations/global-compensation/calculator/">https://about.gitlab.com/handbook/people-operations/global-compensation/calculator/</a> - зарплатный калькулятор в GitLab</li>\n<li><a href="https://soundcloud.com/frontend-weekend/fw-94">https://soundcloud.com/frontend-weekend/fw-94</a> - Денис Мишунов в подкасте Frontend Weekend.</li>\n<li><a href="https://www.youtube.com/channel/UCW9pyonagDWGMCy7V_Kro6g">https://www.youtube.com/channel/UCW9pyonagDWGMCy7V_Kro6g</a> - JavaScript.Ninja от Ильи Климова</li>\n</ul>',excerpt:"Компания GitLab с каждым годом набирает обороты. Как ни странно для OpenSource проекта, из него получился не плохой бизнес! Что интересно, в…",frontmatter:{title:"Зарплаты в GitLab",date:"July 8, 2019",featuredImage:null}},next:null}}}});
